import React from "react";
import '../Styles/CategoryCard.css'

export default function CategoryCard(props) {
  return (
    <div className="CategoryCard m-3 mx-auto CategoryCard" style={{ width: "10rem" }}>
        <img src={props.img}></img>
    </div>
  );
}
